const apiKey = 'ueadg8OeXeVLN9SREtm6hmpPvRpFJlEB';

const peticion = fetch(`https://api.giphy.com/v1/gifs/random?api_key=${ apiKey }`)

peticion.then( resp => {
    //console.log(resp)
    resp.json().then(data => {
        console.log(data);
    })
})
.catch(console.warn);
